import styled from "styled-components";

export const ContactContainer = styled.div`
	top: 50%;
	left: 50%;
	transform: translate(-50%, -50%);

	display: flex;
	flex-wrap: wrap;
	flex-direction: column;
	align-items: center;
`;

export const ContactTitle = styled.h2`
	margin: 10px 0;
`;
